  /** An upper threshold value for acceleration in g-forces. */
    alertAccelerationGMax?: number,
  /** A lower threshold value for acceleration in g-forces. */
    alertAccelerationGMin?: number,
  /** An upper threshold value for battery level percentage. */
    alertBatteryLevelPMax?: number,
  /** A lower threshold value for battery level percentage. */
    alertBatteryLevelPMin?: number,
  /** An upper threshold value for pressure in hectopascals. */
    alertPressureHpaMax?: number,
  /** A lower threshold value for pressure in hectopascals. */
    alertPressureHpaMin?: number,
  /** An upper threshold value for relative humidity percentage. */
    alertRelativeHumidityMax?: number,
  /** A lower threshold value for relative humidity percentage. */
    alertRelativeHumidityMin?: number,
  /** An upper threshold value for temperature in degrees Celsius. */
    alertTemperatureCMax?: number,
  /** A lower threshold value for temperature in degrees Celsius. */
    alertTemperatureCMin?: number,
  /** An upper threshold value for tilt in degrees. */
    alertTiltDegreeMax?: number,
  /** A lower threshold value for tilt in degrees. */
    alertTiltDegreeMin?: number,
  /**
   * True if attach sensor alert in device is enabled.
