   */
    isAttachAlertEnabled?: boolean,
  /**
   * True if tamper sensor alert in device is enabled.
   * @default false
   */
    isTamperAlertEnabled?: boolean,

},
  /**
   * An array of objects that holds sensor logging configurations
   * @maxItems 5
   * @minItems 0
   */
    sensorLoggingConfigurations?: ({
  /**
   * Sampling frequrency of single sensor loggin configuration (in milliseconds)
   * @min 1
   */
    samplingFrequency?: number,
  /** Type of single sensor logging configuration */
    type: "acceleration" | "pressure" | "temperature" | "humidity" | "gnss",

})[],
  /** Flag that sets sensor logging on or off */
    sensorLoggingEnabled?: boolean,
  /**
   * The version of the state of a device. This should be incremented only by HERE Tracking.
   * @min 0
   */
    stateVersion: number,
  /** A boolean value that sets efficient geofencing on or off */
    syncGeofences?: boolean,
  /**
   * An array of objects that holds wlan configurations
